import '../styles/event.css';

function Event() {
  return (
    <>
        <div class="event-section">
            <div class="time">time</div>
            <div class="left-line"></div>
            <div class="dot"></div>
            <div class="left-line"></div>
            <div class="event">
                <div class="event-name"></div>
                <div class="event-section"></div>
            </div>
            <div class="connector"></div>
        </div>
    </>
  );
}

export default Event;
